import React from 'react';

function Tutorial(props) {
    return (
        <div>
            <h1>How to Play Artifice</h1>

            <h2>Teams</h2>
            <p>
            <b>Demons: </b>The goal of the demons to kill every villager. The demons win when the number
            of demons alive is more than or equal to the number of villagers alive.
            </p>
            <p>
            <b>Villagers: </b>The goal of the demons to kill every villager. The demons win when the number
            of demons alive is more than or equal to the number of villagers alive.
            </p>

            <button className='back-button' onClick={props.backClick}>Back</button>
        </div>
    );
}

export default Tutorial;
